// Dependencias
import React from 'react';
import { Route, Switch } from 'react-router-dom'

// Components
import App from '../components/App';
import Inicio from '../pages/inicio';
import Perfil from '../pages/perfil';
import FatallError  from '../pages/500';

const AppRoutes = () =>

    <App>
        <Switch>
            <Route path="/login" component={() => { window.location.href = 
            'https://id.twitch.tv/oauth2/authorize?client_id=n24421j98tu90dqln9hrnknwj7jda7&redirect_uri=http://localhost:3000/&response_type=token%20id_token&scope=openid&claims={ "id_token": { "email": null, "email_verified": null }, "userinfo": { "picture": null, "preferred_username": null } }'
                ; return null;}}/>
            <Route path="/Perfil" component={Perfil} />
            <Route path="/" component={Inicio} />
            <Route component={FatallError }/>
        </Switch>
    </App>;

export default AppRoutes;
